import React from "react";
import { Link } from "react-router-dom";

function Products() {
  return (
    <div className="mt-16">
      <nav>
        <Link to="productlist">Product List</Link>
        <Link to="newproductslist">New Product List</Link>
      </nav>
    </div>
  );
}

export default Products;
